INSERT INTO `tblNews` (`intNewsID`, `strSubject`, `strMessage`, `isArchived`, `dateCreated`) VALUES
(1, 'Streaming URL for Live Show', 'The upcoming LIVE zipTrip "It''s a Gene Thing" on February 20 has URL. We will be offering the live stream in HD. The new Live Stream URL to use for the show is as follows:\r\n<a href="http://www.kaltura.com/tiny/ygfx1">http://www.kaltura.com/tiny/ygfx1</a>.', 0, '2014-01-31 20:32:34'),
(2, 'Streaming URL for Live Show', 'The upcoming LIVE zipTrip "It''s a Gene Thing" on February 20 has URL. We will be offering the live stream in HD. The new Live Stream URL to use for the show is as follows:\r\nhttp://www.kaltura.com/tiny/ygfx1', 1, '2014-01-29 15:59:53'),
(3, 'Student Participation Head Count', 'We have added a profile field requesting the number of students you will have participating in your selected zipTrip. Please go to your profile and update the field named "Class Size." This helps us know audience size, and assists in post-trip assessment. ', 0, '2014-01-29 16:48:30'),
(4, 'Submitting Email Questions During Show', 'With our revised website, we have a new system for submitting email questions during the show. Once the show begins, log into your My zipTrips page, select the "It''s a Gene Thing" show, and you will see the green box on the left side of the screen where you can submit your questions for the show. Just type the question in and hit "Ask!" You ask as many questions as you want. A few days after the show is over, we will send an announcement of a link to all the questions that we couldn''t get to in the show, along with answers by our our scientists.', 0, '2014-02-17 14:22:09'),
(5, 'Test Your Connection For Thursday''s zipTrip', 'We will be streaming a test video for one hour on Wednesday, February 19, at 10:00 ET. This is good time to log in and make sure your system is ready to connect to the live zipTrip the next day (Thursday, February 20). As an additional reminder, we will begin streaming signal ONE HOUR before Thursday''s zipTrip. The test stream will begin at 9:00 a.m. ET, with the "It''s a Gene Thing" zipTrip starting at 10:00 ET. The url for Wednesday''s test and Thursday''s show is:\r\nhttp://www.kaltura.com/tiny/ygfx1', 0, '2014-02-17 14:22:36'),
(6, 'TEST YOUR CONNECTION FOR THURSDAY''S ZIPTRIP!', 'We will be streaming a test video for one hour on Wednesday, February 19, at 10:00 ET. This is good time to log in and make sure your system is ready to connect to the live zipTrip the next day (Thursday, February 20). As an additional reminder, we will begin streaming signal ONE HOUR before Thursday''s zipTrip. The test stream will begin at 9:00 a.m. ET, with the "It''s a Gene Thing" zipTrip starting at 10:00 ET. The url for Wednesday''s test and Thursday''s show is:\r\nhttp://www.kaltura.com/tiny/ygfx1', 1, '2014-02-17 14:21:34'),
(7, 'It''s a Gene Think Archive Recording', 'For all our Gene Thing zipTrippers, you can revisit today''s show (or see it for the first time if you are using it as an archive) at the following url:\r\nhttp://bit.ly/1d6ux36', 0, '2014-02-20 21:47:55'),
(8, 'SCIENTIST EMAIL QUESTIONS ANSWERED!', 'All the email questions we were unable to get to in the show have now been answered by our scientists! You can see them on your "My zipTrips" page under "It''s a Gene Thing." Just click the "Read scientists'' answers to student questions" link!', 0, '2014-02-28 20:54:47'),
(9, 'NEW LINK FOR "IT''S A GENE THING" ARCHIVE', 'We have upgraded the archived recording of the show, and that means a new link. To view the archive visit your "My zipTrips" page, and select "It''s a Gene Thing" for Feb. 20. You will see the link to view the archive.', 0, '2014-02-28 21:00:12'),
(10, 'Hotseat and Social Media Tips', 'Here''s an article with tips on using Hotseat and social media in your classroom for future zipTrips and other events. Feedback from teachers who used Hotseat for zipTrips helped determine these helpful pointers.\r\nhttp://www.learningandleading-digital.com/learning_leading/march_april_2014?pg=37#pg35', 1, '2014-03-12 18:49:42'),
(11, 'Hotseat and Social Media Tips', 'Here''s an article with tips on using Hotseat and social media in your classroom for future zipTrips and other events. Feedback from teachers who used Hotseat for zipTrips helped determine these helpful pointers.\r\nhttp://www.learningandleading-digital.com/learning_leading/march_april_2014?pg=37#pg35', 0, '2014-03-06 21:33:58'),
(12, 'NEW ZIPTRIP ADDED TO SCHEDULE FOR SEPTEMBER!', 'The date for the next zipTrip has been set for Thursday, September 18 at 10:00 ET. This trip will be "Plant Science: The Green Machine!" Genetics. Robots. Climate change. Feeding the world. What do these seemingly diverse fields of study have in common? They are just a few of the many fields of study to be found under the topic of plant science! Take your class on this amazing zipTrip and find out what makes plant sciences "The Green Machine!" Registration is now open!', 0, '2014-04-09 18:44:30'),
(13, 'Register Now For September''s Brand New zipTrip! Plant Science: The Green Machine!', 'Purdue zipTrip is the FREE electronic field trip that brings science education directly to your school. Plant Science: The Green Machine features real scientists touching on a variety of middle school STEM standards, including:\r\n\r\n<ul>\r\n<li>Genetics</li>\r\n<li>Growth, Development, and Reproduction</li>\r\n<li>Weather and Climate</li>\r\n</ul>', 0, '2014-08-11 15:10:58'),
(14, 'Plant Science: The Green Machine offers Hotseat! ', 'Put your class in the Hotseat for our September 18 zipTrip, "Plant Science: The Green Machine!" Hotseat is a social media tool which allows your students the opportunity to interact with the scientists in the show and other classrooms around the country LIVE, during the show! We''ve added Hotseat as an option on the upcoming September zipTrip, so if you are already registered, go to your My zipTrips page and let us know you are interested. If you are registering now, do the same!', 0, '2014-08-11 15:34:30'),
(15, 'Hotseat Update', 'We have an update to our email about using Hotseat in the September 18 "Plant Sciences: The Green Machine" zipTrip. If you are interested in participating in Hotseat, please email us directly at:\r\nziptrips@purdue.edu. We apologize for the confusion.', 0, '2014-08-11 15:53:48'),
(16, 'Register Now For September''s Brand New zipTrip! Plant Science: The Green Machine!', 'Purdue zipTrip is the FREE electronic field trip that brings science education directly to your school. Plant Science: The Green Machine features real scientists touching on a variety of middle school STEM standards, including:\r\n\r\n<ul>\r\n<li>Genetics</li>\r\n<li>Growth, Development, and Reproduction</li>\r\n<li>Weather and Climate</li>\r\n</ul>\r\n\r\n<a href="http://www.purdue.edu/ziptrips/signin.php"><img src="http://www.agriculture.purdue.edu/ziptrips/emailBlast/images/join.jpg" border="0" title="Sign Up Now for The Green Machine!" /></a>', 0, '2014-08-25 15:53:46'),
(17, 'YOUR CLASS CAN BE OUR VIRTUAL STUDIO AUDIENCE', 'Every zipTrip has a "virtual" studio audience...a classroom that can participate live, on camera during the show. Your class can appear on a large screen in the studio to talk with the scientists and ask questions on camera. If you are interested, contact us at: ziptrips@purdue.edu', 0, '2014-09-08 18:36:48'),
(18, 'Plant Science: The Green Machine offers Hotseat!', 'Put your class in the Hotseat for our September 18 zipTrip, "Plant Science: The Green Machine!" Hotseat is a social media tool which allows your students the opportunity to interact with the scientists in the show and other classrooms around the country LIVE, during the show! We''ve added Hotseat as an option on the upcoming September zipTrip, so if you are already registered, go to your My zipTrips page and let us know you are interested. Or you can email us directly at:\r\nziptrips@purdue.edu', 0, '2014-09-08 18:51:20'),
(19, 'zipTrips Plant Science: The Green Machine!', 'Our upcoming zipTrips show is just one week away. Be sure to log in for the 10:00 a.m. webcast on September 17. The URL to link to the show is: http://www.kaltura.com/tiny/n1ckl\r\n\r\nWe will post this on the page for the show as well, which you can access by going to My zipTrips. It is here that you can also access the teacher guide and online supplemental videos!\r\n\r\nWe will be sending regular information out between now and the show. Stay tuned!', 0, '2015-09-10 19:37:13'),
(20, 'Test Your Connection on Monday, September 14!', 'Attention zipTrippers! We will be webcasting a test signal over the URL for the show on Monday, September 14, from 2:30 to 3:00 p.m. This connection is viewable on Windows, Mac, and mobile device platforms. Just log into the test stream at the following URL:\r\n\r\nhttp://www.kaltura.com/tiny/n1ckl\r\n ', 0, '2015-09-10 20:14:25'),
(21, 'zipTrips Plant Science: The Green Machine Archive', 'The zipTrips Plant Science: The Green Machine (High School) archived recording is now available for viewing at:\r\nhttps://www.youtube.com/watch?v=3VGsfEbthEY&feature=youtu.be', 0, '2015-09-22 13:03:14'),
(22, 'NEW ZIPTRIP COMING FOR OCTOBER 2016', 'We are excited to announce that a BRAND NEW zipTrip is coming for the fall semester of 2016! On Friday, October 6, 2016 ZIPTRIPS: DAWN OR DOOM? will be broadcast on in conjunction with Purdue University''s DAWN OR DOOM conference! Watch this space for news on content are for when registration opens. For more about Dawn or Doom, visit: http://www.purdue.edu/dawnordoom', 0, '2016-02-02 21:20:53'),
(23, 'Register Now! zipTrips: Dawn or Doom! October 4!', 'Purdue University presents our BRAND NEW zipTrip! zipTrips: Dawn or Doom? is now open for registration. And remember, it is FREE! Can emerging technologies bring a new dawn of science breakthroughs to improve society? Can technology address issues of feeding a global population, climate change, and food safety without creating further problems? In this installment of Purdue zipTrips, we will be looking at research and technology addressing issues of protecting the quality and supply of water, food safety and security, and benefits and risks of gene editing and modification in animals. Purdue scientists discuss the next generation of technology and research, and address the big-picture issues where both excitement and concern are appropriate responses. Sign up now!\r\n', 0, '2016-08-23 15:07:10'),
(24, 'Coming Soon! A FREE Online STEM Experience! Register Now for zipTripsâ„¢! zipTrips: Dawn or Doom (High School)', 'Join thousands of high school science teachers and students across the country for a unique educational experience! Purdue zipTripsâ„¢ are FREE, interactive electronic field trips that brings science education directly to your school. â€œzipTrips: Dawn or Doom?,â€ scheduled for October 4, will feature live Purdue University scientists touching on a variety of topics based on high school STEM standards, including:\r\n\r\nSecuring our water supply in a time of climate change\r\nGenetically Modified Animals: Risks and Benefits\r\nFood Safety and Security\r\n\r\nIn this zipTripâ„¢, we ask â€œAre we on the brink of dawn? Or Doom?â€ Your students will meet Purdue scientists who are on the cutting edge of research and knowledge!\r\n\r\nIt is easy (just sign up, and we will get you connected), and join this unique educational experience!\r\n\r\nSign up today at https://www.purdue.edu/ziptrips! ', 0, '2016-09-07 14:56:40'),
(25, 'Hotseat', 'Remember...if you haven''t signed your class up to participate via Hotseat, it isn''t too late! As a reminder, here is a reminder of what Hotseat is:\r\n\r\nWhat is Hotseat? Hotseat uses social networking to create a collaborative classroom. During the live show, it allows students to ask questions and post comments, see questions and comments posted by other students, and vote on which questions scientists should answer during the live show.\r\n\r\nHow do students access Hotseat? Students can access Hotseat from almost any device with an Internet connection, including:\r\n\r\n*desktop or laptop computers\r\n*mobile devices, such as cell phones and tablets\r\n*Students can work individually or in groups, depending on how many devices are available.\r\n\r\nWhat software is required? Computer users need an Internet browser to log in through at www.purdue.edu/hotseat. Mobile users will need to download the Hotseat app from the Apple App Store or Google Play. All users will need to create a free Hotseat account to get started.\r\n\r\nCan everyone use Hotseat? Participation through Hotseat is limited, and demand is usually high. If you are interested in volunteering, select this option, and those who are chosen to use this feature will be notified via email.', 0, '2016-09-19 15:41:28'),
(26, 'URL for Tuesday''s zipTrip is now here', 'Hello, zipTrippers! The URL for Tuesday''s show is now established. It is available on the show''s page, but it is also here: http://www.kaltura.com/tiny/owkk5\r\nWe''re going to have a great show! ', 0, '2016-09-29 18:04:14'),
(27, 'TEST YOUR CONNECTION FOR TUESDAY''S SHOW', 'As a school signed up for Tuesday''s DAWN OR DOOM zipTrip, you may want to test your connection to out web stream. Details on where and how to test are below:\r\nDate: Friday, Sept. 30\r\nTime: 2:00 - 3:00 p.m. eastern\r\nTest URL: http://www.kaltura.com/tiny/owkk5\r\nYou will see a graphic an music when connected. ', 0, '2016-09-29 18:20:43'),
(28, 'HOTSEAT USERS UPDATE!', 'MESSAGE FOR HOTSEAT PARTICIPANTS\r\nThe Hotseat for our upcoming show is now ready! To log into it go to: https://www.openhotseat.org\r\n\r\nOnce you are logged in, scroll all the way down to the BOTTOM of the page. There you will find the â€œzipTrips: Dawn or Doomâ€ space. The three topics you see are listed in the order from top to bottom. Just click on the the appropriate one. The zipTrips Correspondent in the show will prompt users when to go to the next topic. \r\n\r\nAlso, in Jane Frankenbergerâ€™s topic there is a poll question. When the poll is live during the show there will be a yellow banner that says â€œPoll in Progress!â€  Just click on it to participate in the poll!\r\n\r\nHotseat is a fun and interactive way for your class to experience Purdue zipTrips!', 0, '2016-09-30 18:08:18'),
(29, 'NEW ZIPTRIP COMING FOR FEBRUARY 2017!', 'Plant scientists are working on a diverse range of important problems, from invasive species to using technology to feed the world to climate change. Take your class on this amazing zipTrip and find out what makes plant sciences "The Green Machine!"', 0, '2016-12-21 20:07:05'),
(30, 'Join Our FREE Virtual Field Trip: zipTrip! PLANT SCIENCES!', 'Plant Science: The Green Machine! \r\n(High School)\r\n\r\nFree! Live! Interactive! Join thousands of high school science teachers and students across the country for a unique educational experience! Purdue zipTripsâ„¢ are unique electronic field trips that brings science education directly to your school. The next zipTrip is "Plant Science: The Green Machine," scheduled for February 23, 2017. Your class will see and have an opportunity to interact with Purdue University scientists as they discuss a variety of topics based on high school STEM standards, including:\r\n\r\nInvasive species\r\nUsing Technology to Feed the World\r\nCarbon Cycle, Biomass, and Climate Change\r\nIn this zipTripâ„¢, it''s all about Plant Science! Your students will meet Purdue scientists who are on the cutting edge of research and knowledge!\r\n\r\nIt is easy (just sign up, and we will get you connected), and join this unique educational experience!', 0, '2017-01-11 13:55:26'),
(31, 'It''s Time to Sign Up For zipTrips!', 'Join Our FREE Virtual Field Trip: zipTrips! \r\nPlant Science: The Green Machine! \r\n\r\nFree! Live! Interactive! Purdue zipTripsâ„¢ bring STEM-based education presented live from Purdue University scientists directly to your classroom! Join thousands of high school science teachers and students across the country for a unique educational experience! The next zipTrip is "Plant Science: The Green Machine," scheduled for February 23, 2017. Your class will see and have an opportunity to interact with Purdue University scientists as they discuss a variety of topics based on high school STEM standards, including:\r\n\r\nInvasive Species\r\nUsing Technology to Feed the World\r\nCarbon Cycle, Biomass, and Climate Change\r\n\r\nIn this zipTripâ„¢, it''s all about Plant Science! Your students will meet Purdue scientists who are on the cutting edge of research and knowledge! It is easy (just sign up, and we will get you connected), and join this unique educational experience! just to to: www.purdue.edu/ziptrips', 0, '2017-02-03 16:03:13'),
(32, 'Hotseat', 'Remember...if you haven''t signed your class up to participate via Hotseat, it isn''t too late! Here is a reminder of what Hotseat is:\r\n\r\nWhat is Hotseat? Hotseat uses social networking to create a collaborative classroom. During the live show, it allows students to ask questions and post comments, see questions and comments posted by other students, and vote on which questions scientists should answer during the live show.\r\n\r\nHow do students access Hotseat? Students can access Hotseat from almost any device with an Internet connection, including:\r\n\r\n*desktop or laptop computers\r\n*mobile devices, such as cell phones and tablets\r\n*Students can work individually or in groups, depending on how many devices are available.\r\n\r\nWhat software is required? Computer users need an Internet browser to log in through at www.purdue.edu/hotseat. Mobile users will need to download the Hotseat app from the Apple App Store or Google Play. All users will need to create a free Hotseat account to get started.\r\n\r\nCan everyone use Hotseat? Participation through Hotseat is limited, and demand is usually high. If you are interested in volunteering, select this option, and those who are chosen to use this feature will be notified via email.', 0, '2017-02-06 21:36:10'),
(33, 'Hotseat', 'Remember...if you haven''t signed your class up to participate via Hotseat, it isn''t too late! Here is a reminder of what Hotseat is:\r\n\r\nWhat is Hotseat? Hotseat uses social networking to create a collaborative classroom. During the live show, it allows students to ask questions and post comments, see questions and comments posted by other students, and vote on which questions scientists should answer during the live show.\r\n\r\nHow do students access Hotseat? Students can access Hotseat from almost any device with an Internet connection, including:\r\n\r\n*desktop or laptop computers\r\n*mobile devices, such as cell phones and tablets\r\n*Students can work individually or in groups, depending on how many devices are available.\r\n\r\nWhat software is required? Computer users need an Internet browser to log in through at www.purdue.edu/hotseat. Mobile users will need to download the Hotseat app from the Apple App Store or Google Play. All users will need to create a free Hotseat account to get started.\r\n\r\nCan everyone use Hotseat? Participation through Hotseat is limited, and demand is usually high. If you are interested in volunteering, select this option, and those who are chosen to use this feature will be notified via email.', 0, '2017-02-06 21:49:26'),
(34, 'Hotseat Participation', 'Remember...if you haven''t signed your class up to participate via Hotseat, it isn''t too late! \r\nHotseat uses social networking to create a collaborative classroom. During the live show, it allows students to ask questions and post comments, see questions and comments posted by other students, and vote on which questions scientists should answer during the live show. Students can access Hotseat from almost any device with an Internet connection, including:\r\n\r\n*desktop or laptop computers\r\n*mobile devices, such as cell phones and tablets\r\n*Students can work individually or in groups, depending on how many devices are available.\r\n\r\nComputer users need an Internet browser to log in through at www.purdue.edu/hotseat. Mobile users will need to download the Hotseat app from the Apple App Store or Google Play. All users will need to create a free Hotseat account to get started.\r\n\r\nParticipation through Hotseat is limited, and demand is usually high. Go to the page for this show and let us know you want to participate!', 0, '2017-02-13 17:02:08'),
(35, 'Hotseat Participation', 'Remember...if you haven''t signed your class up to participate via Hotseat, it isn''t too late! \r\nHotseat uses social networking to create a collaborative classroom. During the live show, it allows students to ask questions and post comments, see questions and comments posted by other students, and vote on which questions scientists should answer during the live show. Students can access Hotseat from almost any device with an Internet connection, including:\r\n\r\n*desktop or laptop computers\r\n*mobile devices, such as cell phones and tablets\r\n*Students can work individually or in groups, depending on how many devices are available.\r\n\r\nComputer users need an Internet browser to log in through at www.purdue.edu/hotseat. Mobile users will need to download the Hotseat app from the Apple App Store or Google Play. All users will need to create a free Hotseat account to get started.\r\n\r\nParticipation through Hotseat is limited, and demand is usually high. Go to the page for this show and let us know you want to participate!', 0, '2017-02-13 20:33:03'),
(36, 'Hotseat Participation!', 'You are signed up for our upcoming zipTrip Plant Science: The Green Machine...why not enhance the experience by having your class participate in Hotseat, our social media application that lets your students answer poll questions, send questions to our scientists, and interact with other students from all over the country who are watching the show! Just go to your My zipTrips page for Plant Science: The Green Machine and select the Hotseat option!', 0, '2017-02-17 18:59:41'),
(37, 'TEST YOUR CONNECTION FOR THURSDAY''S SHOW', 'As a school signed up for Thursdayâ€™s PLANT SCIENCE: THE GREEN MACHINE zipTrip, you may want to test your connection to out web stream. Details on where and how to test are below:\r\nDate: Tuesday, Sept. 21\r\nTime: 3:30 - 4:00 p.m. eastern\r\nTest URL: http://www.kaltura.com/tiny/svtoa\r\nYou will see a graphic and music when connected. ', 0, '2017-02-20 20:44:47'),
(38, 'Hotseat Participation!', 'MESSAGE FOR HOTSEAT PARTICIPANTS\r\n\r\nThe Hotseat for our upcoming show is now ready! To log into it go to: https://www.openhotseat.org.\r\n\r\nOnce you are logged in, click the "Public Spaces" button in the upper right hand corner of the screen, and scroll all the way down to the BOTTOM of the page. There you will find the "zipTrips: The Green Machine-HS Edition" space. The three topics you see are listed in the order from top to bottom. Just click on the the appropriate one. The zipTrips Correspondent in the show will prompt users when to go to the next topic. \r\n\r\nAlso, in Mike Jenkinâ€™s and Jeff Dukeâ€™s sections there are a poll questions. When the poll is live during the show there will be a yellow banner that says â€œPoll in Progress!â€  Just click on it to participate in the poll!\r\n\r\nHotseat is a fun and interactive way for your class to experience Purdue zipTrips!', 0, '2017-02-21 16:30:27'),
(39, 'zipTrips Plant Science: The Green Machine Archive', 'The Feb. 23 zipTrips: Plant Science: The Green Machine is now archived and available to view. Go to your My zipTrips page to see the link, or go directly to: https://youtu.be/2UorlFMtkRA', 0, '2017-02-27 14:40:26'),
(40, 'Register Now! zipTrips: Dawn or Doom! September 27!', 'Purdue University presents our BRAND NEW zipTrip! zipTrips: Dawn or Doom? is now open for registration. And remember, it is FREE! Can emerging technologies bring a new dawn of science breakthroughs to improve society? Can technology find new breakthroughs in genomics, system biology and human health? Can what we learn get us to Mars? In this installment of Purdue zipTrips, we will be looking at research and technology addressing issues of plant science, developing self-sustaining environments, and growing food in space. Purdue scientists discuss the next generation of technology and research, and address the big-picture issues where both excitement and concern are appropriate responses. Sign up now!\r\n\r\nThanks,\r\nPurdue zipTrips', 0, '2017-08-18 12:57:36'),
(41, 'Purdue zipTrips: Dawn or Doom 2017 is Open for Registration!', 'Purdue University presents our BRAND NEW zipTrip! zipTrips: Dawn or Doom? is now open for registration. And remember, it is FREE! Emerging technologies are bringing breakthroughs in genomics, system biology, human health, and creating regenerative environments! Can what we learn get us to Mars? In this installment of Purdue zipTrips, we will be looking at research and technology addressing issues of plant science, developing self-sustaining environments, and growing food in space. Purdue scientists discuss the next generation of technology and research, and address the big-picture issues where both excitement and concern are appropriate responses. Sign up now at: http://www.purdue.edu/ziptrips/', 0, '2017-08-23 12:58:56'),
(42, 'Your Class Can Be In zipTrips: Dawn or Doom!', 'Your class can be in the upcoming zipTrip. Each zipTrip features a live classroom that appears in the show via video conferencing technology. Your class will be seen LIVE, and have the chance to ask questions directly to our scientists! \r\n\r\nWhat is video conferencing? Video conferencing is the ability to send simultaneous two-way video and audio transmissions over the Internet. This will happen through either an IP video conferencing or through a Skype connection. We are limited to one class per live show. If you are interested in volunteering, let us know and we will contact you via email!', 0, '2017-08-24 18:13:59'),
(43, 'Register Now for Free! Purdue zipTrips: Dawn or Doom 2017!', 'Purdue University presents our BRAND NEW zipTrip! zipTrips: Dawn or Doom? is now open for registration. And remember, it is FREE! Emerging technologies are bringing breakthroughs in genomics, system biology, human health, and creating regenerative environments! Can what we learn get us to Mars? In this installment of Purdue zipTrips, we will be looking at research and technology addressing issues of plant science, developing self-sustaining environments, and growing food in space. Purdue scientists discuss the next generation of technology and research, and address the big-picture issues where both excitement and concern are appropriate responses. \r\nSign up now at: http://www.purdue.edu/ziptrips/', 0, '2017-08-29 15:01:11'),
(44, 'zipTrips URL', 'Our upcoming zipTrips: Dawn or Doom 2017 is almost here! It broadcasts on September 27 at 10:00 am ET. You can log into the show at on that day at: http://www.kaltura.com/tiny/zz69y', 0, '2017-09-20 15:22:12'),
(45, 'A Week of Scientists', 'In addition to our upcoming live webcast, Purdue zipTrips offers "A Week of Scientists"â€” five videos highlighting scientists and their work. They are available now on your zipTrips: Dawn or Doom 2017 page!', 0, '2017-09-21 13:50:08'),
(46, 'Hotseat Participation!', 'MESSAGE FOR HOTSEAT PARTICIPANTS\r\n\r\nThe Hotseat for our upcoming show is now ready! To log into it go to: https://www.openhotseat.org.\r\n\r\nOnce you are logged in, click the "Public Spaces" button in the upper right hand corner of the screen, and scroll all the way down to the BOTTOM of the page. There you will find the "zipTrips: Dawn or Doomâ€ space. The three topics you see are listed in the order from top to bottom. Just click on the the appropriate one. The zipTrips Correspondent in the show will prompt users when to go to the next topic. \r\n\r\nAlso, in April Carrollâ€™s section there is a poll question. When the poll is live during the show there will be a yellow banner that says â€œPoll in Progress!â€  Just click on it to participate in the poll!\r\n\r\nHotseat is a fun and interactive way for your class to experience Purdue zipTrips!', 0, '2017-09-26 12:36:58');
INSERT INTO `tblQuestions` (`intQuestionID`, `intTripShowID`, `intUserID`, `strQuestion`, `strAnswer`, `TIMESTAMP`) VALUES
(2, 1, 1, 'Can you see me?!', '', '2014-02-20 14:15:03'),
(3, 1, 46, '', '', '2014-02-20 15:00:59'),
(4, 1, 46, '', '', '2014-02-20 15:01:07'),
(5, 1, 46, 'How do you know which genes are cancer genes?', 'Nadia: There is an ongoing effort to find genes which, when mutated can lead to cancer.Â Â Scientists are still working to better understand cancer and its causes, which are often not just genetic, but environmental.Â Â Scientists do this in a variety of ways.Â Â Scientists look for gene mutations.Â Â For example the can compare gene expression in cancer cells versus normal cells to see which genes are expressed differently between the two samples.Â Â Genes that are expressed differently between cancer and non-cancer cells can be targeted for future experiments.Â Â Another way scientists study these genes is to look for mutations in the genes and then try to figure out what these mutations do.', '2014-02-20 15:01:38'),
(6, 1, 46, 'What progress are you making on a breast cancer cure?', '', '2014-02-20 15:02:21'),
(7, 1, 46, 'What kind of plants are you experimenting with and why?', 'Nadia: In our lab we mainly focus on ferns.Â Â We do this for a number of reasons.Â Â First, because ferns evolved before seed plants, if we learn about ferns, we can use this information to learn a lot about seed plants.Â Â Also the particular questions we are interested in require that we study these ferns.Â Â Ceratopteris richardii has a fast life cycle, its sex is environmentally determined, and is very easy to perform genetics on (crosses, gene knock-outs, etc).Â Â Pteris vitatta can tolerate 100-1000x more arsenic then other plants and also hyperaccumulates arsenic - it is the only multicellular organism that can do this.Â Â We also use Arabidopsis thaliana, (a flowering plant) sometimes as a tool.Â Â This is because Arabidopsis thaliana is a model system and is very easy to do genetics with.', '2014-02-20 15:02:59'),
(8, 1, 46, 'If you can turn off and on a gene for diseases, can you turn other genes on and off?', 'Nadia: We can turn genes on and off.Â Â For example, you can knock-down the expression of the gene or produce a knock-out that has the gene off completely to see what happens when the gene is not on.Â Â Similarly, you can increase expression of genes.Â Â These techniques are very powerful tools.', '2014-02-20 15:05:51'),
(9, 1, 46, 'Are all diseases somehow caused by our genes?', 'Nadia: Not all diseases are caused by our genes.Â Â Diseases can also be caused by pathogens, such as bacteria and parasites.Â Â Furthermore the environment can have a large impact on health.Â Â For example, arsenic exposure can lead to different types of cancer developing.Â Â And smoking greatly increases the chances of getting cancer.Â Â Many times a combination of gene mutations and environmental causes can lead to disease.', '2014-02-20 15:08:17'),
(10, 1, 43, 'Why is it important to know the sex of a plant?', 'Nadia: It is important to know the sex of a plant for agriculture and plant breeding.Â Â The sex of a plant determines which plants can be bred and can influence cultivation in some cases.Â Â For example, if you have two plants and do not know that they are both female, you can waste time and money trying to breed them, without any success.', '2014-02-20 15:19:13'),
(11, 1, 142, 'Why did you choose those two species of fish to study?', 'Matt: I choose to work with rainbow and brook trout because of their different migratory patterns. One of the great things about working with salmon and trout is that migrant individuals look very different from resident individuals. This difference allows us to know if an individual migrated versus stayed at home. This is something that''s really tough to do with other migratory species like birds, or insects. As I said in the live broadcast, salmon and trout are a great system for asking questions about migration!', '2014-02-20 15:22:46'),
(12, 1, 142, 'Does the sex of the fish determine whether they migrate?', 'Matt: Interesting question! So, both males and females migrate, and both males and females stay at home. However, in the population in Alaska I''m working on, we see a lot more females migrating than males. Anecdotally, we know that not all populations have the same differences between the sexes.', '2014-02-20 15:23:26'),
(13, 1, 43, 'Why do plants have different colors, even different colors on the same plant?', 'Nadia: Plants make a number of pigments such as chlorophyll (green), carotenoids\r\n(yellow/orange), tannins (brown), flavonoids (red, purple, blue).  The\r\ndifferent colors on plants are often due to the production of these\r\ndifferent compounds.  Transposable elements (TEs also known as "jumping\r\ngenes") are sometime responsible for the different patters you see on\r\nplants as well.  For example, some leaf and flower variegation patterns\r\nare caused by TEs.', '2014-02-20 15:26:33'),
(14, 1, 43, 'Does fish DNA look different from human DNA?', 'Matt: Fish DNA is essentially identical from human DNA. Fish have genes that are no longer in human DNA, and vice versa, but the structure of the DNA is essentially identical from humans to mice to birds to fish to insects!', '2014-02-20 15:27:05'),
(15, 1, 43, 'Do fish have blood types like humans?', 'Matt; I''m not sure if fish have different blood types in the way humans do, so types AB, B, A and O. I don''t know if anyone''s looked to see if there are different blood types between different individuals. Interesting question!Â ', '2014-02-20 15:33:45'),
(16, 1, 142, 'Are any of the Salamander species you study poisonous?', '', '2014-02-20 15:37:01'),
(17, 1, 142, 'Are the species of Salamanders able to interbreed?', 'Rod: There have been occasions where different salamander species have hybridized with one another. In this historic events (~5 million years ago), those hybrids produced unisexual, all-female populations.Â  I do not believe there are any interbreeding species at this point in geologic time.\r\nAndrew:  By definition, most â€œspeciesâ€ cannot breed with one another.Â  In other words, salamanders of species â€œAâ€ can breed with each other but not with those from species â€œBâ€ or â€œCâ€.Â  Eastern tiger salamanders (Ambystoma tigrinum tigrinum) can breed with each other but not with smallmouth salamanders (Ambystoma texanum).', '2014-02-20 15:37:37'),
(18, 1, 142, 'How do you relate what you learn about Salamanders to humans?', 'Andrew:  Salamanders choose their mates in part based on how they smellâ€”just like in humans!Â  The same complex of genes are responsible for mate choice in humans and salamanders.Â  These genes are involved in disease resistance.Â  The idea is that humans and salamanders both prefer mates that will effectively resist parasites and pathogens.', '2014-02-20 15:38:23'),
(19, 1, 28, 'If the tiger salamander was migrating where did you catch it?', '', '2014-02-20 15:39:38'),
(20, 1, 142, 'Do Salamanders return to where there parents were like other organisms, or do they go to any body of water?', 'Rod: Some individuals do and some donâ€™t.Â  It depends on the availability of available breeding ponds, the distance between those ponds, and the sex of the individual.\r\nAndrew: Tiger salamanders are thought to return to the same body of water to breed, much like salmon.Â  The scientific term for this behavior is â€œphilopatryâ€, which means site-loving.', '2014-02-20 15:40:10'),
(21, 1, 43, 'Does the DNA of a salamander determine its poison?', 'Rod: To some degree, yes. We know that in other taxa, frogs for example, some of their toxins come from their diet.\r\nAndrew: When disturbed, some salamanders can release toxins.Â  The exact composition of these toxins is indeed determined by the animalâ€™s DNA!', '2014-02-20 15:40:49'),
(22, 1, 142, 'Do you use Punnet Squares when you study the fish and what do they usually look like?', 'Matt: Punnet squares are great if the inheritance of the trait you are looking at is relatively simple (I.e. Only one or two genes are involved), like the color of mice in the example Nadia went through. But, for traits and behaviors that have many MANY genes involved punnet squares aren''t that great! It looks like migration in trout and salmon is controlled by at least 200 genes, that would be a HUGE square!', '2014-02-20 15:51:11'),
(23, 8, 1, 'This was added manually by Kenny so that zipTrips could see this show and feel secure that the site works. Do not answer.', '', '2014-09-18 12:29:19'),
