(27, 13, 1525, 'How much does the Pinorover cost to build to conduct this study?', '', '2017-02-23 15:25:03'),
(28, 13, 1526, 'How much money did it take to build that tractors and how long did it take to build?', '', '2017-02-23 15:27:49'),
(29, 13, 1526, 'How long as the experiment been going on and who can participate in the experiment? ', '', '2017-02-23 15:45:10'),
(30, 13, 1529, 'What''s your favorite part about your job ', '', '2017-02-23 15:51:07'),
(31, 13, 1527, 'Melba~\r\nDo you use organizers such as Punnett squares when finding out the likely hood of a strain of corn being resistant? Or do you use other methods. ', '', '2017-02-23 15:52:21'),
