INSERT INTO `tblTrip` (`intTripID`, `strTitle`, `strDescription`, `isArchived`, `strGrade`, `isFeatured`, `strPhoto250`, `strPhoto400`, `strPhoto600`, `strTeacherGuide`, `strBlurb`, `isBanner`) VALUES
(1, 'We''re All Animals', 'Kids and animals may not look a lot alike, but they still have many similarities, especially in how they move and live. Join Purdue scientists as they take you on a virtual visit to the Purdue campus. Look inside a state-of-the-art horse treadmill laboratory. Meet real-world scientists who use scientific inquiry every day in their work. Become a scientist, too, by using scientific inquiry to learn about animals, humans, and their body systems.\r\n', 0, '6th', 0, 'https://www.purdue.edu/ziptrips/images/trips/wa250.jpg', 'https://www.purdue.edu/ziptrips/images/trips/wa400.jpg', 'https://www.purdue.edu/ziptrips/images/banners/studio.jpg', 'https://www.purdue.edu/ziptrips/assets/AnimalsTeacher.pdf', 'What is it like to be a veterinarian? How is the human body like an animalâ€™s body? Why is that horse really running on a treadmill? Take the â€œWeâ€™re All Animalsâ€ zipTrip and find out!', 1),
(2, 'Disease Detectives', 'Different diseases have plagued humans and animals for millions of years. In this virtual field trip from Purdue University, learn how scientists are like detectives when it comes to finding clues about the cause and prevention of disease. Meet Purdue scientists who treat pigs with swine flu, help solve a mysterious disease case using scientific inquiry, and take a look at how Purdue scientists are using cutting-edge technology to go inside our bodies and treat infection. This visit includes a stop at the Purdue School of Veterinary Medicine to see what happens when a dog takes a turn in the dentist''s office.', 0, '7th', 0, 'https://www.purdue.edu/ziptrips/images/trips/dd250.jpg', 'https://www.purdue.edu/ziptrips/images/trips/dd400.jpg', 'https://www.purdue.edu/ziptrips/images/banners/hotseatclassroom.jpg', 'https://www.purdue.edu/ziptrips/assets/DiseaseDetectiveTeacher.pdf', 'Just like detectives, scientists use cutting edge tools and techniques to solve the puzzle of disease â€” everything from a veterinarianâ€™s visit to sick farm animals to a dogâ€™s visit to the dentist!', 1),
(3, 'It''s a Gene Thing!', 'Why do humans and animals look and act the way they do? It''s all about DNA! In this zipTrip, learn how Purdue scientists are studying the building blocks of life.\r\n', 0, '6th', 0, 'https://www.purdue.edu/ziptrips/images/trips/gt250.jpg', 'https://www.purdue.edu/ziptrips/images/trips/gt400.jpg', 'https://www.purdue.edu/ziptrips/images/banners/gt.jpg', 'https://www.purdue.edu/ziptrips/assets/GeneThingTeacher.pdf', 'From the tiniest DNA inside a single cell to the wilds of Alaska, this zipTrips teaches us that itâ€™s all in the genes!', 0),
(4, 'The Science of Nutrition', 'This zipTrip features Purdue scientists researching nutrition topics such as calcium consumption and snacking habits, physical activity, and environmental concepts that impact kids'' health. The United States Department of Agriculture''s MyPlate recommendations for healthy eating and exercise are also incorporated into this zipTrip. Get your students thinking about health and nutrition topics, science, and science careers, which influence their everyday lives now and into the future.\r\n', 0, '8th', 0, 'http://www.purdue.edu/ziptrips/images/trips/sn250.jpg', 'http://www.purdue.edu/ziptrips/images/trips/sn400.jpg', '', 'https://www.purdue.edu/ziptrips/assets/NutritionTeacher.pdf', 'How does the sense of smell influence how food tastes? How do scientists determine a healthy diet? Is nutrition a â€œscience?â€ Take this zipTrip and find out!', 0),
(5, 'Plant Science: The Green Machine', 'Genetics. Robots. Climate change. Feeding the world. What do these seemingly diverse fields of study have in common? They are just a few of the many fields of study to be found under the topic of plant science! Take your class on this amazing zipTrip and find out what makes plant sciences "The Green Machine!"', 0, '7th', 0, 'http://www.purdue.edu/ziptrips/images/trips/gm250.jpg', 'http://www.purdue.edu/ziptrips/images/trips/gm400.jpg', '', 'https://www.purdue.edu/ziptrips/assets/GreenMachineTeacher.pdf', 'Plant science isnâ€™t just growning plants! This amazing zipTrip shows the incredible diversity in the field of plant science â€” everything from the rise of new species to robots to climate change.', 0),
(6, 'Plant Sciences: The Green Machine (High School)', 'There are enormous problems facing an increasingly complicated world. Invasive species. Genetically modified organisms. Climate change. Feeding an increasing world population. They are just a few of the many issues plant scientist are working on. Take your class on this amazing zipTrip and find out what makes plant sciences "The Green Machine!"', 0, 'High School', 0, 'http://www.purdue.edu/ziptrips/images/trips/gmhs250.jpg', 'http://www.purdue.edu/ziptrips/images/trips/gmhs400.jpg', 'http://www.purdue.edu/ziptrips/images/trips/gmhs1900.jpg', '', 'Plant scientists are working on a diverse range of important problems, from invasive species to GMOs to climate change. Take your class on this amazing zipTrip and find out what makes plant sciences "The Green Machine!"\r\n', 1),
(7, 'zipTrips: Dawn or Doom? 2016', 'Can emerging technologies bring a new dawn of safety and insights to improve society? Can science and technology address issues of feeding a global population, climate change, and food safety without creating further problems? Are we on the brink of dawnâ€¦or doom? In this installment of Purdue zipTrips, we will be looking at research and technology addressing issues of food protecting the quality and supply of water, food safety and security, and benefits and risks of gene editing and modification in animals. Purdue scientists discuss the next generation of technology and research, and address the big-picture issues where both excitement and concern are appropriate responses.\r\n', 0, 'High School', 0, 'http://purdue.edu/ziptrips/images/trips/dod250.jpg', 'http://purdue.edu/ziptrips/images/trips/dod400.jpg', 'http://purdue.edu/ziptrips/images/trips/dod1900.jpg', '', 'Can emerging technologies bring a new dawn of breakthroughs to improve society? This zipTrip looks at how science and technology can help feed a global population, protect our water supply in a time of climate change, and secure food safety for a growing world population. ', 1),
(8, 'zipTrips: Dawn or Doom? 2017', 'Can emerging technologies bring a new dawn of safety and insights to improve society? Can science and technology address issues of climate change and feeding a global population, make living on Mars feasible, and advance human health without creating further problems? Are we on the brink of dawnâ€¦or doom? In this installment of Purdue zipTrips, we will be looking at research and technology addressing issues of advanced plant phenomics , how this technology helps make growing food in space possible, and how lessons learned in this process can apply to human and animal health. Purdue scientists discuss the next generation of technology and research, and address the big-picture issues where both excitement and concern are appropriate responses.', 0, 'High School', 1, 'http://purdue.edu/ziptrips/images/trips/dod2017250.jpg', 'http://purdue.edu/ziptrips/images/trips/dod2017400.jpg', '', '', 'Can emerging technologies bring a new dawn of breakthroughs to improve society? This zipTrip looks at how science and technology address issues of climate change and feeding a global population, is making living on Mars feasible, and is advancing human health. ', 0);
