INSERT INTO `tblTripVideo` (`intTripVideoID`, `intTripID`, `strVideoTitle`, `strVideoDescription`, `strVideoURL`) VALUES
(6, 2, 'The Case of the Mysterious Bug Bite', 'Watch as scientists tell about solving the case of a mysterious bug bite. Unusual bug bites can be serious, and diagnosing what the insect was is vital to getting proper treatment.', 'http://www.youtube.com/watch?v=mdM_pjtaoGg '),
(10, 2, 'The Case of the Rotten Tomato', 'Why do foods like fresh tomatoes get rotten and spoil? How do you solve the mystery of keeping food wholesome and fresh longer? ', 'http://www.youtube.com/watch?v=lzMMVntFpe0&feature=youtu.be '),
(22, 1, 'A Week of Scientists: Brian MacGowan', 'Scientists work in areas you might have not even thought of! Not every scientist works in a traditional laboratory. Meet Brian MacGowan, who studies animals in their natural habitat. His lab is the great outdoors...from the deep woods to your backyard!', 'http://www.youtube.com/watch?v=LouykQV2hDc&feature=youtu.be'),
(23, 1, ' A Week of Scientists: Alyssa Panitch', 'Alyssa Panitch is a Purdue University bioengineer who uses synthetic materials such as plastic and rubber to help heal and repair the human body.', 'http://www.youtube.com/watch?v=tvnJAyq-SMY&feature=youtu.be'),
(24, 1, 'A Week of Scientists: Elizabeth Pappas', 'Elizabeth Pappas studies rain and water flow, and how they affect the world we live in. Her field of work makes her a hydraulic engineer.', 'http://www.youtube.com/watch?v=hTC9kcSbXbk&feature=youtu.be'),
(25, 1, 'A Week of Scientists: Brad Duerstock', 'Brad Duerstock is a paralysis researcher at the Center for Paralysis Research at Purdue University, where he works to find new ways to treat and cure the effects of spinal cord injuries.', 'http://www.youtube.com/watch?v=5eP29jJx5ps&feature=youtu.be'),
(26, 1, 'A Week of Scientists: Tom Turpin', 'Entomology is the study of insects...all things creepy and crawly! Tom Turpin is an entomologist who studies bugs at Purdue University!', 'http://www.youtube.com/watch?v=u1dw-zJPCLE&feature=youtu.be'),
(27, 2, 'The Case of the Atomic Scale Doctor', 'Not all diseases are infectious. Scientists are working on diagnosing and curing noninfectious diseases such as cancer. Here you will meet a scientist working in the amazing new frontier of nano medicine in pursuit of new cancer treatments.', 'http://www.youtube.com/watch?v=vZOEq0chbTc'),
(28, 2, 'The Case of the Suspected Field Fungus', 'Human and animal diseases aren''t the only living things that need diagnosis and treatment. Meet a Purdue scientist who is known as a "plant doctor!"', 'http://www.youtube.com/watch?v=Hnl4HBAU5mw'),
(29, 2, 'The Case of the Infectious Iguana', 'Meet the scientists who work at the Indiana Medical Disease Diagnostic Lab as they relate how they solved the case of a baffling illness with an unusual cause.', 'http://www.youtube.com/watch?v=wiQ0AePZwnA'),
(30, 3, 'The Gene Team: Gebisa Ejeta', 'Meet Gebisa Ejeta, whose successful plant genetics research has literally saved millions of lives in Africa.', 'http://www.youtube.com/watch?v=gbl0ckixnWs&list=PLE73247B1A657AD11&index=13'),
(32, 3, 'The Gene Team: Marisol SepÃºlveda ', 'Marisol SepÃºlveda and her team study genetic mutations and changes in fish to see how environmental factors such as pollution work on organisms.', 'http://www.youtube.com/watch?v=g9WHSa4RkpA&list=PLE73247B1A657AD11&index=12'),
(33, 3, 'The Gene Team: Sophie LeliÃ¨vre', 'Sophie LeliÃ¨vre leads a multinational team studying the genetics of breast cancer and working toward better treatments and, ultimately, a cure.', 'http://www.youtube.com/watch?v=HnjobZWz8Ww&list=PLE73247B1A657AD11&index=11'),
(34, 3, 'The Gene Team: Terry Stewart', 'Terry Stewart uses mathematical models to study genetic patterns in populations. Using pig populations, he and his team can breed animals that are less vulnerable to allergies and disease.', 'http://www.youtube.com/watch?v=U-8nwn3H6hg&list=PLE73247B1A657AD11&index=10'),
(35, 3, 'The Gene Team: Jim Clemens', 'Jim Clemens studies genetics at the molecular level, including DNA copies, mutations, and how genes are turned on and off. His research is helping discover cures and treatments for diseases such as Alzheimer''s disease and Parkinson''s disease.', 'http://www.youtube.com/watch?v=fnHyALq0Aqs&list=PLE73247B1A657AD11&index=9'),
(36, 4, 'â€ªMario Ferruzziâ€¬:â€ª Micronutrient Researcherâ€¬', 'Meet Mario Ferruzzi, nutrition scientist working in the area of micro-nutrients. These include vitamins and minerals in foods and phytochemicalsâ€”chemicals with nutritional benefitsâ€”in plants. ', 'http://www.youtube.com/watch?v=KB-ZuE9CHIM&list=PLE73247B1A657AD11&index=19'),
(37, 4, 'Nana Gletsu-Miller: Nutrition Scientist', 'Nana Gletsu-Miller is a researcher studying how deficiencies in minerals such as zinc and copper can affect energy levels and immune system problems.', 'http://www.youtube.com/watch?v=Z-mim4Fa4wM&list=PLE73247B1A657AD11&index=18'),
(38, 4, 'Rachel Clark: Sports Nutritionist', 'For athletes to perform at the highest level takes hard work...and science! Rachel Clark is a sports nutritionist for Purdue University athletics. Proper nutrition is vital in building strength, recovering from intense exercise, and boosting the immune system. The science of sports nutrition helps keep athletes performing and playing at their optimum abilities.', 'http://www.youtube.com/watch?v=Y1Aqe0fuJWc&feature=youtu.be'),
(39, 5, 'Peter Hirst: Growing Better Apples', 'Meet horticulture professor Peter Hirst, who is researching ways to achieve a higher intensity of production in a smaller amount of land. Professor Hirst''s specialty is growing bigger, better apples!', 'http://www.youtube.com/watch?v=4wbi-IdDKks'),
(40, 5, 'Cale Bigelow: Turfgrass Scientist', 'We all encounter turfgrass every day in our lawns, parks, and sporting venues. Adapting grasses for different uses is a specialty science, and Cale Bigelow is a scientist working to produce plants that are more drought resistant, greener, and better able to take the pounding of games such as football.', 'http://www.youtube.com/watch?v=HxmcgFjIRnc'),
(41, 5, 'Gebisa Ejeta: Ending Hunger and Saving Lives', 'Plant breeder, geneticist, and World Food Prize winner Dr. Gebisa Ejeta''s work in developing parasite- and drought-resistant crops in Africa feeds millions of people and saves countless lives.', 'http://www.youtube.com/watch?v=vcnJbVcrAXU'),
(42, 6, 'Plant Science: The Green Machine â€” Gebisa Ejeta: Ending Hunger and Saving Lives', 'World Food Prize Winner Gebisa Ejeta discusses his plant science research, which is helping end hunger and literally saving millions of lives in Africa. ', 'https://www.youtube.com/watch?v=vcnJbVcrAXU'),
(44, 6, 'Plant Science: The Green Machine â€” Cale Bigelow: Turf Grass Science', 'Purdue researcher Cale Bigelow gives us insight into the little-known field of Turf Science, showing there''s a lot more to growing a green lawn than meets the eye!', 'https://www.youtube.com/watch?v=HxmcgFjIRnc'),
(45, 6, 'Plant Science: The Green Machine â€” Peter Hirst: Growing Better Apples', 'Purdue Plant Scientist Peter Hirst takes us on a visit to his outdoor laboratory â€” an apple orchard! He''s using it to unlock the genetic secrets to produce a better apple!', 'https://www.youtube.com/watch?v=4wbi-IdDKks'),
(46, 6, 'Plant Science: The Green Machine â€“ Brian Dilkes: On the Frontier of Human Knowledge', 'Meet plant science associate professor Brian Dilkes, who is research in plant breeding and genetics that is on the frontier of human knowledge. What is learned from his experiments will not only produce more and better corn, but could also lead to how whole new species may arise!', 'https://www.youtube.com/watch?v=bCloLa8ZimI'),
(47, 7, 'zipTrips Dawn or Doom: Nanomedicine ', 'Nanomedicine is the revolutionary technology of applying nanotechnology to the treatment of disease. Nanomedicine includes the medical applications of nanomaterials and biological devices, nanoelectronic biosensors, and the future applications of molecular biological machines. Here you will tour a cutting-edge facility developing new techniques for treating human disease, including cancer.', 'https://www.youtube.com/watch?v=SKEiU8QtVwM&feature=youtu.be'),
(48, 7, 'zipTrips Dawn or Doom: Cutting Edge Cancer Research', 'Cancer is an ancient scourge of mankind. Fighting cancer has required difficult treatments like radiation and chemotherapy. But in recent years, scientists like those at the Purdue Cancer Center are unlocking new insights into how cancer lives and multiplies, and new ways to fight one of man''s oldest enemies.', 'https://www.youtube.com/watch?v=aQq1EdyO0co&feature=youtu.be'),
(49, 7, 'zipTrips Dawn or Doom: The Challenge of Climate Change ', 'Climate change is more than just an increase in temperature. It is a complicated and interconnected series of issues that require a multi-disciplinary approach, creative thinking, and understanding.', 'https://youtu.be/_0OqIxNDYqg'),
(50, 8, 'A Week of Scientists: Bryan Pijanowski', 'Purdue scientist Bryan Pijanowski uses environmental sound recording to document our changing world.', ' https://youtu.be/B1CoF9VnD70'),
(51, 8, 'A Week of Scientists: The AgBot Challenge', 'A team of Purdue students accept a challenge to convert a utility side-by-side into an autonomous robotic vehicle.', 'https://youtu.be/Ge9WRBfTzYA'),
(52, 8, 'A Week of Scientists: Kevin Jackson and Jada Powlen', 'Learn from two Purdue Turf Science students how this field of science is important for everything from your lawn to a football field!', 'https://youtu.be/Mvnv17LlE4chttps://www.youtube.com/watch?v=Mvnv17LlE4c&feature=youtu.be'),
(53, 8, 'A Week of Scientists: Josh Craver', 'Purdue scientist Josh Craver offers insights into the futuristic field of vertical farming, which is paving the way for breakthroughs in food production here on Earth and is space!', 'https://www.youtube.com/watch?v=SsYGGU8hqUY&feature=youtu.be'),
(54, 8, 'A Week of Scientists: Steven Lindemann', 'Purdue Food Scientist Josh Craver discusses the latest, cutting-edge research in Food Science.', 'https://www.youtube.com/watch?v=EcUn5heOV7s&feature=youtu.be');
